import "./mainPage.css";

function MainPage(props) {
  return (
    <div className="mainPage">
      <p className="name-en">Iris Qin</p>
      <img src={require('./photo.png')} alt="photo" className="photo-img"></img>
      <p className="name-cn">秦天</p>
    </div>
  );
}

export default MainPage;
